void update_location_UFO(UFO *ufo, char PS2Data, MISSILE *missile, volatile int *pixel_ctrl_ptr){
    if(PS2Data == 0x29  && turn){
        playsound(0);
        MISSILE old_missile = {missile->x, missile->y, 0, 0};
        clear_Missile(&old_missile);
        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);
        clear_Missile(&old_missile);
        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);
        missile->x = ufo->x;
        missile->y = ufo->y;
        if(ufo->dx > 0){
            missile->dx = 7;
            missile->dy = 0; 
        }
        else if(ufo->dx < 0){
            missile->dx = -7;
            missile->dy = 0;
        }
        else if(ufo->dy > 0){
            missile->dx = 0;
            missile->dy = 7;
        }
        else if(ufo->dy < 0){
            missile->dx = 0;
            missile->dy = -7;
        }
        else{
            missile->dx = 0;
            missile->dy = 0;
        }
        turn = 0;
    }
    else if(PS2Data == 0x74){
        ufo->dx = 2;
        ufo->dy = 0;
        turn = 1;
    }
    else if(PS2Data == 0x6B){
        ufo->dx = -2;
        ufo->dy = 0;
        turn = 1;
    }
    else if(PS2Data == 0x72){
        ufo->dy = 2;
        ufo->dx = 0;
        turn = 1;
    }
    else if(PS2Data == 0x75){
        ufo->dy = -2;
        ufo->dx = 0;
        turn = 1;
    }
    if(ufo->x < 1  || ufo->x > 314){
        ufo->dx = -ufo->dx;
    }
    else if(ufo->y < 13 || ufo->y > 234){            //These lines have to be changed.
        ufo->dy = -ufo->dy;
    }
    ufo->x += ufo->dx;
    ufo->y += ufo->dy;
    ufo->x += ufo->dx;
    ufo->y += ufo->dy;
}

